import React from 'react'
import logo from '../images/taiLogo.png'
import styles from '../css/login.css'
export default function centerIcon() {
    return (
        <div>
             <Link to={"/"} ><img alt="Image html" className="center" src={logo} /> </Link>
            
        </div>
    )
}
